'Using an opcode cache allows all your PHP scripts to run faster by caching a "compiled" (opcode) version of the scripts instead of recompiling everything at every page load. Several opcode caches are available. We recommend APC (which is included with PHP starting from PHP 7).' => 'L\'utilisation d\'un cache d\'opcode permet à tous vos scripts PHP d\'être exécutés plus vite en utilisant une version "compilée" (ocpcode) depuis le cache plutôt que de tout recompiler à chaque chargement de page. Il existe plusieurs caches d\'opcode. Nous recommandons APC (lequel est inclus dans PHP à partir de la version 7).',
'Using an user cache allows b2evolution to store some cached data (Block Cache) in memory instead of regenerated the blocks at each page load. Several user caches are available. We recommend APCu (which needs to be enabled separately from APC, starting from PHP 7).' => 'L\'utilisation d\'un cache de données utilisateur permet à b2evolution de stocker des données (Cache de Blocs) en mémoire au lieu de devoir les regénérer à chaque requête utilisateur. Il existe plusieurs caches de données utilisateur. Nous recommandons APCu (lequel doit être activé séparément de APC à partir de PHP version 7).',
