'WARNING: Some of your tables have a different charset than the expected %s. It is strongly recommended to normalize your database charset by running the preselected task below:' => 'ATTENTION: Certaines de vos tables utilisent un jeu de caractères différent de jeu %s attendu. Il est fortement recommandé de convertir le jeu de caractères de votre base de données en utilisant la tâche présélectionnée ci-dessous:',
