'<strong>Delete b2evolution tables &amp; cache files. WARNING:</strong> All your b2evolution tables and data will be lost! Any non-b2evolution tables will remain untouched.' => '<strong>Supprimer les tables &amp; et les fichiers cache de b2evolution. ATTENTION: Toutes vos tables et données b2evolution seront perdues!!!</strong> Toute table n\'appartenant pas à b2evolution restera cependant inchangée.',
