'<strong>Convert/Normalize your DB to UTF-8/ASCII</strong>: The content tables in your b2evolution MySQL database will be converted to UTF-8 instead of their current charset. Some system tables will also be converted to plain ASCII for better performance.' => '<strong>Convertissez/Normalisez votre BD vers UTF-8</strong>: toutes les tables de b2evolution dans votre base MySQL b2evolution seront converties vers UTF-8 en lieu et place de leur jeu de caractères actuel. Certaines tables système seront également converties en ASCII pour une meilleur performance.',
